INSERT INTO `abouts` (`id`, `video_link`, `image`, `image_small`, `details`, `status`, `published_by`, `created_by`, `created_at`, `updated_at`) VALUES
(5, 'https://www.youtube.com/embed/c5UrQw-zmsA', 'public/images/about/original/oNK17.jpg', 'public/images/about/small/oNK17.jpg', '<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">C.P.\r\nGROUP<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;\r\ncolor:#202122\">The&nbsp;Charoen\r\nPokphand&nbsp;(CP) Group was established in Thailand in 1921. It is\r\nThailand\'s largest private company and one of the world\'s largest\r\nconglomerates. The company having eight businesses lines&nbsp;covering 13\r\nbusiness groups. As of 2020&nbsp;the group has investments in 21 countries.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;\r\ncolor:#202122\"><o:p>&nbsp;</o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">C.P.\r\nBANGLADESH CO., LTD. <o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">In the year 1998 CP group started its\r\nbusiness in Bangladesh under the name of CP Bangladesh Co., Ltd. (CPB) with a\r\nvision ‘<b>’kitchen of Bangladesh.”</b>\r\nRight now CP in Bangladesh multifaceted with three major components of\r\nbusiness: feed, farm and food having all the following business units: Feed\r\nBusiness, </span><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\">Breeder Farm Business</span><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">,\r\n</span><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\">Hatchery Business</span><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">,\r\nBroiler Farm Business, Layer Farm Business, </span><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\">Contract farming Business</span><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">,\r\nAquaculture Business &amp; </span><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">&nbsp;</span><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\">Food Business</span><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">.</span><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">&nbsp;</span><b><span style=\"font-size:11.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;\r\ncolor:#202122\"><o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">C.P.\r\nFOOD BUSINESS<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:11.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;\r\ncolor:#202122\">&nbsp;</span></b><span style=\"font-size: 11pt; line-height: 115%; font-family: Cambria, serif;\">CP Food Business is\r\none of the three core businesses of </span><span style=\"font-size:11.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:115%;font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Arial;color:#202122\">CP Bangladesh Co., Ltd. started in\r\n2008 with the slogan of <b>“Food to enrich\r\nlife”</b>. CP Food business has 3 major parts;<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\"><o:p>&nbsp;</o:p></span></p><p style=\"margin: 0in 0in 0.0001pt 0.25in; text-indent: -0.25in; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:11.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:115%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#202122\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">CP Five Star<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt 0.25in; text-indent: -0.25in; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:11.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:115%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#202122\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">CP Modern Trade<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt 0.25in; text-indent: -0.25in; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span style=\"font-size:11.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:115%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#202122\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\r\n&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">CP Fresh Chicken<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Arial;color:#202122\"><o:p>&nbsp;</o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-family: Cambria, serif;\">CP Five Star</span></b><b><span style=\"mso-bidi-font-size:11.0pt;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:\r\nArial\"><o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11pt; font-family: Cambria, serif;\">To meet the huge customer demand of ready\r\nfood, CP Food inaugurated its business in Bangladesh since 2008 under the brand\r\nname <b>\'CP Five Star\'</b> and from the\r\nbeginning, it has been providing the most hygienic, nutritious, safe and Halal ready\r\nfood to the customers.</span><span style=\"font-size:11.0pt;font-family:&quot;Cambria&quot;,serif;\r\nmso-bidi-font-family:Arial\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"mso-bidi-font-size:11.0pt;\r\nfont-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNoSpacing\" style=\"line-height:115%\"><b><span lang=\"EN-GB\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif\">CP Modern Trade <o:p></o:p></span></b></p><p class=\"MsoNoSpacing\" style=\"line-height:115%\"><span lang=\"EN-GB\" style=\"font-family:&quot;Cambria&quot;,serif\">CP Food business </span><span lang=\"EN-GB\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial\">inaugurated pack\r\nbrand of frozen &amp; chilled processed foods and CP Fresh Eggs in Modern trade\r\nchannel in Bangladesh since 2010. Chicken Ball, Sausage, Nuggets, Lollipop,\r\nBologna, Chicken Patty and Frank Cocktail are available in Super Stores like;\r\nShwapno, Meena Bazar, Agora &amp; Unimart.<o:p></o:p></span></p><p class=\"MsoNoSpacing\" style=\"line-height:115%\"><span lang=\"EN-GB\" style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\"><o:p>&nbsp;</o:p></span><b style=\"font-size: 1rem; letter-spacing: 0.3px; text-align: justify;\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;color:#202122\">CP\r\nFresh Chicken</span></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:Arial;\r\ncolor:#202122\">C.P. Bangladesh Co., Ltd. is rearing chicken by using own Feed\r\n&amp; chicks. Then slaughtering at own slaughter house which is the largest in\r\nBangladesh maintaining EU standard and Halal process recommended by Islamic\r\nFoundation. Serving in different channels like Hotels, Super Shops, Café,\r\nRestaurants etc. </span><span style=\"font-family:&quot;Cambria&quot;,serif;mso-bidi-font-family:\r\nArial;color:#202122\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,sans-serif;color:#202122\"><o:p>&nbsp;</o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt\"><o:p>&nbsp;</o:p></p>', '1', '7', '9', '2020-06-24 11:20:45', '2021-02-04 15:36:38');
