INSERT INTO `posts` (`id`, `title`, `header`, `image`, `image_small`, `details`, `status`, `published_by`, `created_by`, `created_at`, `updated_at`) VALUES
(20, 'C.P. Bangladesh Co,.Ltd', 'CP Bangladesh  Details', 'public/images/posts/original/postvIv7I.jpg', 'public/images/posts/small/postvIv7I.jpg', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">CP Bangladesh strictly performs to prevent COVID-19</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">Covid-19 pandemic has severely affected the global food industry including the major food producing countries like the United States, Germany, United Kingdom and Brazil where many meat processing plants and food factories had to shut down or temporarily closed after finding infected employees.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">CP Bangladesh wasn\'t restless too with these matters and continues to implement the highest prevention procedure at all times to keep food safety from the upstream of chain until deliver to the hands of consumers.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">CP Bangladesh has studied and transcribed the success story from the prevention of CP Business in Wuhan, China which has become the source of the enhancement of protection under a single standard policy, from the animal feed factories, farms and food factories till delivery and distribution.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">CP Bangladesh checks body temperature of all employees, as well as promoting hygiene practices including wearing a mask and regularly washing hands, increase the frequency of cleaning with disinfectants in areas and frequently exposed areas.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">In addition, CP Bangladesh has defined social distancing and physical distancing as strictly guidelines, to reduce the risk of spreading in the factory as much as possible. Since the travel of employees, the company has increased the number of trips, shuttle employees in order to sit on the shuttle at a distance of at least 1 meter as well as refrain from the unnecessary factory visit activities and screening customers and visitors strictly for maximum security, not allowed all staff traveling to risky areas and some of staff to have work from home.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">CP Bangladesh Fresh chicken, meat and meat products are from chickens raised from CP Bangladesh\'s farms. The farm area is controlled by Bio security standards system, which is effective in preventing disease to enter to farm and the chicken is rearing within the closed house system and environmental controlled system to suit the growth of chickens in each age range. It is not necessary to use hormones to accelerate growth, including animal feed used from CP feed factories and can be traceable to safe sources of raw materials. This is to ensure the safety in working for all employees and for 100% safety for the consumers.</div></div>', '1', '1', '9', '2020-06-25 00:22:04', '2020-12-07 17:09:47'),
(26, 'CP Fresh Chicken', 'Fresh Chicken', 'public/images/posts/original/postUrQoy.png', 'public/images/posts/small/postUrQoy.png', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">Free home delivery ( Inside Dhaka )</div><div dir=\"auto\" style=\"font-family: inherit;\">For order: +88019 26699948</div><div dir=\"auto\" style=\"font-family: inherit;\">This offer is only applicable from CP Catering Service.</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; white-space: pre-wrap; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5);\"><div dir=\"auto\" style=\"font-family: inherit;\">*Conditions Apply.</div></div>', '1', '9', '9', '2020-12-26 11:52:04', '2021-01-12 10:18:49'),
(27, 'Brand ambassadors', 'Brand ambassadors of CP Five Star Bangladesh.', 'public/images/posts/original/postQBmJk.png', 'public/images/posts/small/postQBmJk.png', '<span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; white-space: pre-wrap;\">Congratulations to Irfan Sajjad &amp; Sallha Khanam Nadia to be the brand ambassadors of CP Five Star Bangladesh.</span>', '1', '9', '9', '2021-01-12 10:23:39', '2021-01-12 10:23:52'),
