(62, 'CP Italian Bologna', 2, NULL, 'public/images/posts/original/postbTmiP.png', 'public/images/posts/small/postbTmiP.png', 'public/images/products/original/productYCYpO.png', 'public/images/products/small/productYCYpO.png', 'public/images/products/original/productBBqpu.png', 'public/images/products/small/productBBqpu.png', '<p style=\"margin: 0in 0in 7.5pt; font-size: 15px; line-height: 1;\"><a name=\"_Hlk58936194\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">Storage Instruction</span>:</span></a><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\"></span>&nbsp;Keep Refrigerated at 0<span style=\"color: rgb(51, 51, 51); font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: 0.25pt;\">°</span><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">-4</span><span style=\"color: rgb(51, 51, 51); font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: 0.25pt;\">°</span><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">C</span>&nbsp;<span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: 0.25pt;\">.</span><span style=\"font-size: 11.5pt; font-family: &quot;Segoe UI&quot;, sans-serif; letter-spacing: 0.25pt;\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 7.5pt; font-size: 15px; line-height: 1;\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">Weight:&nbsp;</span></span><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">340 gm</span><span style=\"font-size: 11.5pt; font-family: &quot;Segoe UI&quot;, sans-serif; letter-spacing: 0.25pt;\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 7.5pt; font-size: 15px; line-height: 1;\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 10.5pt; letter-spacing: 0.25pt;\">Cooking Instruction:</span>&nbsp;</span></p><p class=\"MsoNormal\" style=\"font-size: 15px;\"><span style=\"font-size: 12pt; line-height: 17.12px; font-family: &quot;Times New Rom